import './App.css';

const setUrl = () => {
  var e = ['🏻', '🏼', '🏽', '🏾', '🏿'];

      function loop() {
          var s = '',
              i, m;

          for (i = 0; i < 10; i ++) {
              m = Math.floor(e.length * ((Math.sin((Date.now()/100) + i)+1)/2));
              s += '👶' + e[m];
          }

          location.hash = s;

          setTimeout(loop, 50);
      }

      loop();
}

